  [],\n\t\"revision_timestamp\": \"2015-05-07T15:23:02.117024\",\n\t\"name\": \"core-flight-software-cfs-maturation-towards-human-rating-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The Core Flight Software (CFS)
  system developed by Goddard Space Flight Center, through experience on Morpheus,
  has proven to be a quality product and a viable candidate for institutional software
  reuse on a broad range of NASA spaceflight projects, including in the near term
  MMSEV, HDU, spacesuits, downmass capsule, and OCO-3. The productivity and success
  seen with it can be extrapolated into tremendous savings if applied to human spaceflight
  software, but diligence needs to be done in assessing its use for large human-rated
  systems. If deemed viable, the potential exists to reform the state of practice
  in building human spacecraft software systems by capitalizing upon reuse and realizing
  a great potential for cost, schedule, and risk reduction.&lt;/p&gt;\",\n\t\"license_title\":
